/*
*  Name_file :Router.js
*  Description: contiene rutas asociadas a componentes
*/

import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Login from '../pages/login/Login';
import Home from '../pages/home/Home';
import HomeAdmin from '../pages/home/HomeAdmin';
import HomeTeacher from '../pages/home/HomeTeacher';
import HomeStudent from '../pages/home/HomeStudent';


/*defino las rutas de los componentes
ejemplo ruta o url del login donde estara alojado/relacionado el componente Login*/
function Routes() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component={Home} />
        <Route exact path="/login" component={Login} />
        <Route exact path="/homeAdmin" component={HomeAdmin} />
        <Route exact path="/homeTeacher" component={HomeTeacher} />
        <Route exact path="/homeStudent" component={HomeStudent} />

      </Switch>
    </BrowserRouter>
  );
}

export default Routes;
